import React,{useState,useEffect} from 'react'
import axios from 'axios'
import {
    useSearchParams
  } from "react-router-dom";

import ProjectCardData from './ProjectCardData';
import './ProjectCardData.scss';


const ProjectCard = () => {

    const [searchParams] = useSearchParams();

    const [dashboardData,setDasboardData] = useState([]);
    // const dashboardData=[{
    //     projectName : "Cipla",
    //     logoUrl : "https://i.postimg.cc/Z9Wbf1Lk/stock-illustration-awesome-abstract-consulting-design-template-logo-icon-isolated-free.jpg",
    //     status : "INPROGRESS",
    //     startDate : "01-01-2022",
    //     endDate : "01-12-2022" ,
    //     numberOfBugs : 1000,
    //     numberOfDependencies : "45%",
    //     codeReviews : "21%",
    //     unitTesting :"10%",
    //     delay : 45
    // },
    // ]

     const getProjectDetails =()=>{ 
         axios.get(`http://13.233.18.99:3010/api/v1/projects/getOverallproject ${searchParams.get('id')}`)
         .then((response)=>{
            setDasboardData(response.data)
             console.log("api",response.data);
         })
         .catch(error=>console.log(error))


    }
    useEffect(()=>{

        getProjectDetails();
    },[]);


    return (
        <div>

                {dashboardData?.content?.projects && dashboardData?.content?.projects.map((data) =>
                    <ProjectCardData data={data} />
                )}
            </div>
    )
}

export default ProjectCard;
